import React from "react";
import  ReactDOM  from "react-dom";
import App from "./components/App";
import cars from "./components/practice";


const [hondacity,Tesla] = cars;

const{speedstaus:{topspeed : hondacityspeed ,zerotosixty: hondacityzts}} = hondacity;
const{speedstaus:{topspeed : Teslaspeed ,zerotosixty:Teslazts}} = Tesla;
const{color:hondacolor} = hondacity;
const{color:Teslacolor} = Tesla;


ReactDOM.render(
    <div>
    <table>
        <tr>
            <th>Model</th>
            <th>Top speed</th>
            <th>ZeroToSixty</th>
            <th>Top color</th>
        </tr>
        <tr>
            <td>{cars.name}</td>
            <td>{hondacityspeed}</td>
            <td>{hondacityzts}</td>
            <td>{hondacolor}</td>
        </tr>
        <tr>
            <td>{Tesla.name}</td>
            <td>{Teslaspeed}</td>
            <td>{Teslazts}</td>
            <td>{Teslacolor}</td>
        </tr>
    </table>
    </div>

,document.getElementById("root"));
